result:
.dashboard {
  &-container {
    margin: 30px;
  }
  &-text {
    font-size: 30px;
    line-height: 46px;
  }
}
  .main-content{
    position: relative;
    width: 100%;
    min-height: 100px;
    background: #fff;
    box-shadow: 0 0 10px 5px rgba(153,153,153,0.1);
    margin: 0 auto;
    padding: 10px 10px;
  }
  .input-content{
    height: 40px;
    margin-top: 20px;
    width: 100%;
    display: flex;
    flex-direction: row;
    align-items: center;
  }
  .input-item{
    float: left;
    margin-left: 35px;
  }
  .divider{
    width: 0;
    height: 30px;
    border-left: #aaa 1px solid;
    margin-left: 35px;
  }
  .table-box {
    width: 100%;
    min-height: 400px;
    background: #fff;
    box-shadow: 0 0 10px 5px rgba(153, 153, 153, 0.1);
    padding: 10px;
  }
  .box-title {
    width: 100%;
    height: 40px;
    &-span {
      color: #4AB7BD;
      font-size: 20px;
      font-weight: bold;
    }
  }
  .col_dialog {
    width: 100%;
    min-height: 100px;
    display: flex;
    flex-direction: column;
  }
